import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on a category card to trigger product loading
    await page.waitForSelector('.category-card', { timeout: 5000 });
    await page.click('.category-card:has-text("Electronics")');

    // Wait for products to load and take screenshot
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_loaded.png'));

    // Rapidly add multiple items to cart using different selectors
    const addToCartButtons = await page.$$('.add-to-cart');

    for (let i = 0; i < Math.min(5, addToCartButtons.length); i++) {
      await addToCartButtons[i].click();
      // Small delay between clicks to simulate rapid but separate actions
      await page.waitForTimeout(200);
    }

    // Take screenshot after adding items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_items_added.png'));

    // Verify cart count updated
    const cartCount = await page.$eval('.cart', el => {
      return parseInt(el.textContent.trim());
    });

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_final.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_final.png'));

    return {
      success: true,
      action: "Added multiple items to cart rapidly and verified cart count update",
      extractedData: {
        cartCount: cartCount,
        itemsAdded: Math.min(5, addToCartButtons.length)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
